settings.cardCss:
body {
            background-color: #333;
            color: #fff;
            font-family: Arial, sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
        }

        .container {
            text-align: center;
        }

        h1 {
            font-size: 2em;
            margin-bottom: 30px;
            color: #f8fdf6;
        }

        .logo {
            width: 170px;
            margin-bottom: 120px;
        }

        .menu {
            display: grid;
            grid-template-columns: repeat(2, 1fr); 
            gap: 1px;
            justify-items: center;
        }

        .menu-view-8 {
            align-content: center;
            text-align: center;
            margin: 0 40px;
            cursor: pointer;
        }

        .menu-view-8 img {
            width: 120px;
            height: 140px;
            display: block;
            margin: 0 auto 10px;
        }

        .menu-view-8 p {
            margin: 0;
            font-size: 1.5em;
            color: #f8fdf6;
        }
        .menu-view-8:hover {
            background-color: #555;
            border-radius: 8px;
            transition: background-color 0.3s ease;
        }
        .status-box {
            display: flex;
            flex-direction: column;
            gap: 5px;
            margin-left: 13px;
            font-size: 0.9em;
            justify-content: center;
        }

        .status-table {
            display: grid;
            grid-template-columns: repeat(4, 1fr);
            gap: 1px;
            text-align: center;
            border: 1px solid #888;
            padding: 1px;
            background-color: #444;
            border-radius: 8px;
        }

        .status-cell {
            padding: 10px;
            border-radius: 4px;
            color: white;
        }
        
        .green {
            background-color: #4CAF50;
        }

        .red {
            background-color: #FF4C4C;
        }

        .threshold-values {
        font-size: 1.2em;
        color: #fff;
        }
